import React from 'react';
import ImageButton from '../atoms/imageButton';
import './sidebar.css';


function Header() : any {
  const imgUrl = '../../resource/image/friend-icon.png';

  return (
    <div className="sidebar">
      <ImageButton imageSrc={imgUrl} alt={'친구'}/>
    </div>
  );
}

export default Header;
